def a(n):
    s=[]
    x=0
    while n>0:
        x=n%3
        n//=3
        if x==2:
            x=-1
            n+=1
        s.append(x)
    return s
print([n for n in range(1, 5001) if a(n).count(1)==a(n).count(-1) and a(n).count(-1)==a(n).count(0)]) # _Indranil Ghosh_, Jun 07 2017

